import React from 'react'

const NotificationBox = ({ response, responseData }) => {
    console.log(response)

    if (response){
        if (response.status === 409){
            return (
                <div>
                    <b>{response.data}</b> + ',' + ' ' + {responseData.errorMessage}
                </div>    
            )
        }
        if (response.status === 201){
            return (
                <div>
                    {response.data + ' ' +  responseData.successMessage}
                </div>
            )
        }
    }
    return null     

}

export default NotificationBox
